import React from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
// @material-ui/icons
import MenuBookIcon from '@material-ui/icons/MenuBook';
import Favorite from "@material-ui/icons/Favorite";
// core components
import Header from "components/Header/Header.js";
import Footer from "components/Footer/Footer.js";
import Button from "components/CustomButtons/Button.js";
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import HeaderLinks from "components/Header/HeaderLinks.js";
import NavPills from "components/NavPills/NavPills.js";
import Parallax from "components/Parallax/Parallax.js";
import Description from "./Description";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import ListItemText from "@material-ui/core/ListItemText";
import ListItemAvatar from "@material-ui/core/ListItemAvatar";
import Divider from "@material-ui/core/Divider";


import profile from "assets/img/faces/221678.png";

import studio1 from "assets/img/examples/727928.png";
import studio2 from "assets/img/examples/772543.png";
import studio4 from "assets/img/examples/831643.jpg";
import studio5 from "assets/img/examples/847278.png";

import styles from "assets/jss/material-kit-react/views/profilePage.js";

const useStyles = makeStyles(styles);

export default function ProfilePage(props) {
   const classes = useStyles();
   const { ...rest } = props;
   const imageClasses = classNames(
      classes.imgRaised,
      classes.imgRoundedCircle,
      classes.imgFluid
   );
   const navImageClasses = classNames(classes.imgRounded, classes.imgGallery);
   return (
      <div>
         <Header
            color="transparent"
            brand="JOJO"
            rightLinks={<HeaderLinks />}
            fixed
            changeColorOnScroll={{
               height: 200,
               color: "white",
            }}
            {...rest}
         />
         <Parallax
            small
            filter
            image={require("assets/img/examples/754796.jpg")}
         />
         <div className={classNames(classes.main, classes.mainRaised)}>
            <div>
               <div className={classes.container}>
                  <GridContainer>
                     <GridItem xs={12} sm={12} md={6}>
                        <div className={classes.profile}>
                           <div>
                              <img
                                 src={profile}
                                 alt="..."
                                 className={imageClasses}
                              />
                           </div>
                           <div className={classes.name}>
                              <h3 className={classes.title}>Joseph Joestar</h3>
                              <h6>second generation of Jojo</h6>
                              <Button justIcon link className={classes.margin5}>
                                 <i className={"fab fa-twitter"} />
                              </Button>
                              <Button justIcon link className={classes.margin5}>
                                 <i className={"fab fa-instagram"} />
                              </Button>
                              <Button justIcon link className={classes.margin5}>
                                 <i className={"fab fa-facebook"} />
                              </Button>
                           </div>
                        </div>
                     </GridItem>
                     <GridItem xs={12} sm={12} md={6}>
                      <Description />
                     </GridItem>
                  </GridContainer>

                  <GridContainer justify="center">
                     <GridItem
                        xs={12}
                        sm={12}
                        md={12}
                        className={classes.navWrapper}
                     >
                        <NavPills
                           alignCenter
                           color="primary"
                           tabs={[
                              {
                                 tabButton: "Favorites",
                                 tabIcon: Favorite,
                                 tabContent: (
                                    <GridContainer justify="center">
                                       <GridItem xs={12} sm={12} md={4}>
                                          <img
                                             alt="..."
                                             src={studio1}
                                             className={navImageClasses}
                                          />
                                          <img
                                             alt="..."
                                             src={studio2}
                                             className={navImageClasses}
                                          />
                                       </GridItem>
                                       <GridItem xs={12} sm={12} md={4}>
                                          <img
                                             alt="..."
                                             src={studio5}
                                             className={navImageClasses}
                                          />
                                          <img
                                             alt="..."
                                             src={studio4}
                                             className={navImageClasses}
                                          />
                                       </GridItem>
                                    </GridContainer>
                                 ),
                              },
                              {
                                 tabButton: "Lines",
                                 tabIcon: MenuBookIcon,
                                 tabContent: (
                                  <List className={classes.root}>
                                  <ListItem>

                                     <ListItemText
                                        primary="Age"
                                        secondary="19"
                                     />
                                  </ListItem>
                                  <Divider variant="inset" component="li" />
                                  <ListItem>

                                     <ListItemText primary="Location" secondary="England" />
                                  </ListItem>
                                  <Divider variant="inset" component="li" />
                                  <ListItem>

                                     <ListItemText primary="Email"  />
                                  </ListItem>
                               </List>
                                 ),
                              },

                           ]}
                        />
                     </GridItem>
                  </GridContainer>
               </div>
            </div>
         </div>
         <Footer />
      </div>
   );
}
